import React from "react";

export default function Propiedades(props){
    return(
<ul>
    <li>nombre {props.nombre}</li>
    <li>{props.edad}</li>
    <li>{props.goles}</li>
    <li>{props.altura}</li>
    <li>{props.partidos}</li>
</ul>
    );
}
